import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { searchSlice } from '../redux/searchSlice';

//Components Provided by MUI

import Box from '@mui/material/Box';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import { useTheme } from '@mui/material/styles';







export default function DetailSearch(props) {

    const theme = useTheme();
    let detailBoxToggle = useSelector(state => state.searchSlice.isDetailBoxOpened);

    return (
        <Box
            sx={{
                width: 300,
                height: 200,
                backgroundColor: 'white',
                boxShadow: 3,
                position: 'absolute',
                zIndex: 1000,
                borderRadius: theme.shape.borderRadius,
                //display: 'none'
            }}
        >
            <FormGroup>
                <FormControlLabel control={<Checkbox defaultChecked />} label="食べ放題" />
                <FormControlLabel disabled control={<Checkbox />} label="飲み放題" />
                <FormControlLabel control={<Checkbox defaultChecked />} label="食べ放題" />
                <FormControlLabel disabled control={<Checkbox />} label="飲み放題" />
                <FormControlLabel control={<Checkbox defaultChecked />} label="食べ放題" />
                <FormControlLabel disabled control={<Checkbox />} label="飲み放題" />
                <FormControlLabel control={<Checkbox defaultChecked />} label="食べ放題" />
                <FormControlLabel disabled control={<Checkbox />} label="飲み放題" />

                <FormControlLabel control={<Checkbox defaultChecked />} label="食べ放題" />
                <FormControlLabel disabled control={<Checkbox />} label="飲み放題" />
            </FormGroup>

        </Box>

    )


}
